import React from 'react';
import './App.css';
import { Title, SubTitle, Text, CoverText, Signature, Iconic } from './components/Text/Text';
import { MenuBar, MenuBarItem } from './components/MenuBar/MenuBar';

function App() {
  return (
    <div className="App">
			<div id="cover" className="Section">
				<div position="center" className="Container">
					<Signature text="Kasper JÃ¸rgensen"></Signature>
					<CoverText text="UX DESIGNER & DEVELOPER"></CoverText>
				</div>
				<div className="Shadow"></div>
			</div>
			<div id="intro" className="Section">
				<MenuBar>
					<MenuBarItem></MenuBarItem>
				</MenuBar>
				<div position="paragraph left" className="Section">
					<SubTitle text="My name is Kasper"></SubTitle>
					<Text text="I am a danish UX designer, with a bachelor's degree in Interaction Design and I have always had the passion for creating great user experiences."></Text>
					<Text text="My motivation is the current lack of user insights and involvement, at today's companies, that often leads to misunderstandings and frustrated users."></Text>
				</div>
			</div>
			<div id="skills" className="Section"></div>
			<div id="ux" className="Section"></div>
			<div id="projects" className="Section"></div>
			<div id="contact" className="Section"></div>
			<div id="footer" className="Section"></div>
    </div>
  );
}

export default App;
